import "./App.css";
import request from "request-promise";
import cheerio from "cheerio";

function App() {
  const response = request({
    uri: "https://www.economist.com/",
    headers: {
      Accept:
        "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8",
      "Accept-Encoding": "gzip, deflate, br",
      "Accept-Language":
        "en-US,en;q=0.9,fr;q=0.8,ro;q=0.7,ru;q=0.6,la;q=0.5,pt;q=0.4,de;q=0.3",
      "Cache-Control": "max-age=0",
      Connection: "keep-alive",
      Host: "www.economist.com",
      "Upgrade-Insecure-Requests": "1",
      "User-Agent":
        "Mozilla/5.0 (Macintosh; Intel Mac OS X 10_12_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Safari/537.36",
    },
    gzip: true,
  });

  console.log(response);

  let title = $('div[class="title_wrapper"] > h1').text().trim();
  let rating = $('div[class="ratingValue"] > strong > span').text();
  let ratingCount = $('div[class="imdbRating"] > a').text();

  let data = {
    title,
    rating,
    ratingCount,
  };

  console.log(data);
  return (
    <div className="App">
      <div className="styled-masthead css-xwvrp9w e12sucsj1">
        <header data-test-id="Masthead" className="ds-masthead">
          <div className="ds-layout-masthead">
            <a href="/">
              <img id="ds-economist-logo" className="ds-masthead-logo" alt="" />
            </a>
          </div>
        </header>
      </div>
    </div>
  );
}

export default App;
